import React from 'react';

function Home() {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'top' }}>
      <div style={{ flex: '1', marginLeft: '20px' }}> {/* Adjusted for left alignment */}
        <img src="./han.jpeg" style={{ maxWidth: '100px' }} />
        <h2>Han Jang</h2>
        <p style={{ fontWeight: 'bold', fontStyle: 'italic' }}>
          Undergraduate Research Student
        </p>
        <p>Computer Vision, Medical Imaging</p>
        <div style={{ fontSize: '12px' }}>
          <p><i className="fas fa-map-marker-alt"></i> Daejeon, Republic of Korea</p>
          <p><i className="fab fa-github"></i> <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">GitHub</a></p>
          <p><i className="fas fa-graduation-cap"></i> <a href="https://scholar.google.com" target="_blank" rel="noopener noreferrer">Google Scholar</a></p>
        </div>
      </div>
      <div style={{ flex: '2', maxWidth: '800px', margin: 'auto' }}> {/* Adjusted for center alignment */}
        <h1>About Me!</h1>
        <p>I'm an undergraduate research student with a profound interest in Human Research...</p>
        {/* More content follows */}
      </div>
    </div>
  );
}

export default Home;
